import Image from 'next/image';
import Link from 'next/link';

function Nav() {
	return (
		<nav className="w-full flex items-center justify-between py-35 px-16">
			<div className="mainLogo flex items-center justify-center w-1/4">
				<Image
					src="/transparenta-logo.svg"
					alt="Transparenta Logo"
					layout="intrinsic"
					width="350px"
					height="28.16px"
				/>
			</div>
			<ul className="nav-items flex items-center justify-end w-3/4">
				<li>
					<Link href="/proactiva">
						<a className="font-bold">Transparencia proactiva</a>
					</Link>
				</li>
			</ul>
		</nav>
	);
}

export default Nav;
